Ext.data.JsonP['PyDev_Go_to_Definition']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Go to definition</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p>\n\t\t</div>\n        <div class=\"header\"/>\n\n        <div id=\"src-30083069\" class=\"content\">\n                        <h1>Go to definition</h1>\n    <p><strong class=\" \">KEYBINDING:</strong> F3    </p>\n    <p>The &apos;go to definition&apos; actions enables you to get to a given definition.    </p>\n<ul class=\"alternate \"><li class=\" \">    <p>It is <strong class=\" \">pretty fast</strong>    </p>\n</li><li class=\" \">    <p>It works well on <strong class=\" \">&apos;self&apos;</strong> tokens    </p>\n</li><li class=\" \">    <p>It can work on methods / attributes from <strong class=\" \">parameters</strong> (as the image below shows).    </p>\n</li></ul>    <p>    <img src=\"images/pydev.org/images/gotodefinition/gotodefinition.png\" alt=\"images/pydev.org/images/gotodefinition/gotodefinition.png\" class=\"confluence-embedded-image confluence-external-resource confluence-content-image-border\">\n        </img></p>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=30083069\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"PyDev Go to Definition"});